import React from "react";
import { BrowserRouter as Router } from  "react-router-dom";
import Routes from "./Routes";
import Header from "./partials/Header";
import Footer from "./partials/Footer";

function App(){
    return(
        <Router>
            <div>
                <Header/>
                    <Direccionamiento/>
                    
                <Footer/>
            </div>
        </Router>
    )
}

export default App;
